import React, { useState } from 'react';
import CustomerCards from './App';
function AppCard() {
  const [activeTab, setActiveTab] = useState(1); // Example state for active tab

  return (
    <div className="App">
      {/* Example buttons to toggle tabs */}
      <button onClick={() => setActiveTab(1)}>Tab 1</button>
      <button onClick={() => setActiveTab(2)}>Tab 2</button>

      {/* CustomerCards component */}
      <CustomerCards activeTab={activeTab} />
    </div>
  );
}

export default AppCard;
